import {useEffect, useState} from "react";

export default function Dashboard(){
    const [data, setData] = useState([])
    useEffect(() => {
        fetch("http://localhost:8081/users")
            .then(res => res.json())
            .then(data => setData(data))
            .catch(err => console.log(err))
    }, []);
    return(
        <table>
            <thead>
                <th>Email</th>
                <th>Password</th>
            </thead>
            <tbody>
            {data.map((d, i) => (
                <tr key={i}>
                    <td>{d.email}</td>
                    <td>{d.password}</td>
                </tr>
            ))}
            </tbody>
        </table>
    )
}
